import { Link } from "react-router-dom";
import { connect, useDispatch } from "react-redux";
import React, { useEffect } from "react";
import Nav from "../f_nav/nav";
import { getCountries } from "../../f_redux/f_actions/actions";

require("./home.css");

require("./home.css");

function Home({ state }) {
  var { countries } = state;
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getCountries());
  }, []);

  if (countries) {
    //countries=countries.slice(0,9)
    return (
      <div className="homeDiv">
        <Nav></Nav>
        <div className="divRowColCountries">
          {countries.map((ct) => (
            <div className="div-comp-country" key={ct.id}>
              <Link to="/home/details">
                <h4>{ct.name}</h4>
              </Link>
              <h4>{ct.continent}</h4>
              <Link to={`/home/details`}>
                <img className="imgFlat" src={ct.imgflat} alt=""></img>
              </Link>
            </div>
          ))}
        </div>
      </div>
    );
  } else {
    return (
      <div className="homeDiv">
        <Nav></Nav>
        <h4>cargando</h4>
      </div>
    );
  }
}
function mapStateToProps(state) {
  return { state };
}

export default connect(mapStateToProps, {})(Home);
